    <div className="card">
        <span className="title">Story Title</span>
        <img src={require('./images/Fire.png')} alt="" className="img" />
        <p className="desc">This is a sample description,</p>
        <button className="actionButton">Read More</button>
    </div>
  );
};

export default StoryCard;
